O curso é para quem: 

- nunca meditou e quer iniciar com uma orientação sólida de quem já medita há décadas;
- já medita, mas sente que não consegue evoluir na prática;
- tenta meditar e se frustra por não alcançar os resultados que idealizou;
- deseja retomar a prática em um ambiente que promove a evolução conjunta;
- sente que precisa de uma pausa reflexiva e descobrir uma nova ferramenta para lidar com os desafios mentais e emocionais...

