“Workshop Alimentação Saudável e Espiritualidade”

Alimentação saudável não precisa ser sofrimento.
Ela pode ser um gesto de cuidado.
Um momento de presença.
Um ato de amor com o corpo que te acompanha todos os dias.

Quando você organiza sua alimentação,
você organiza o seu tempo,
sua energia
e até os seus pensamentos.

🌱 Prepare hoje, coma bem a semana toda.
Sem pressa.
Sem culpa.
Sem excesso.

Neste workshop, você vai aprender a:
✨ Organizar sua alimentação semanal e ganhar mais tempo para você;
✨ Reduzir o desperdício e simplificar a rotina;
✨ Higienizar corretamente os alimentos e armazenamento;
✨ Pré-cozinhar sem perder nutrientes e energia dos alimentos;
✨ Montar refeições leves, equilibradas e rápidas para o seu dia a dia; 
✨ Usar temperos naturais e anti-inflamatórios para uma vida mais saudável;
✨ Compreender o caminho que o alimento faz dentro do seu corpo;
✨ Reconhecer o poder da água e da hidratação do corpo;
✨ Compreender que se alimentar é muito mais que saciar a fome e sim fonte de energia; 
✨ Alimentos ricos em nutrientes para preceitos e jejuns;
✨ Dicas e receitas de lanches para preceitos e jejuns; 
✨ Dicas de sucos detox para desintoxicar o corpo físico e melhorar a conexão espiritual;

